{"text": ["<li>An <a href=\"/wiki/Judiciary_of_India\" title=\"Judiciary of India\">Indian court</a> sentences <a href=\"/wiki/Kashmir_conflict\" title=\"Kashmir conflict\">Kashmiri separatist leader</a> <b><a href=\"/wiki/Yasin_Malik\" title=\"Yasin Malik\">Yasin Malik</a></b> <i>(pictured)</i> to life in prison.</li>", "<li>In the United States, nineteen children and two teachers are killed in <b><a href=\"/wiki/Robb_Elementary_School_shooting\" title=\"Robb Elementary School shooting\">a mass shooting</a></b> at an <a href=\"/wiki/Elementary_schools_in_the_United_States\" title=\"Elementary schools in the United States\">elementary school</a> in <a href=\"/wiki/Uvalde,_Texas\" title=\"Uvalde, Texas\">Uvalde, Texas</a>.</li>", "<li>In <a href=\"/wiki/Association_football\" title=\"Association football\">association football</a>, <a href=\"/wiki/Manchester_City_F.C.\" title=\"Manchester City F.C.\">Manchester City</a> win <b><a href=\"/wiki/2021%E2%80%9322_Premier_League\" title=\"2021\u201322 Premier League\">the Premier League</a></b>.</li>", "<li>The <a href=\"/wiki/Australian_Labor_Party\" title=\"Australian Labor Party\">Australian Labor Party</a>, led by <a href=\"/wiki/Anthony_Albanese\" title=\"Anthony Albanese\">Anthony Albanese</a>, wins the most seats in  <b><a href=\"/wiki/2022_Australian_federal_election\" title=\"2022 Australian federal election\">the Australian federal election</a></b>.</li>"]}
