{"text": ["<li>... that it is rumored that the <b><a href=\"/wiki/Puente_de_Fierro\" title=\"Puente de Fierro\">Puente de Fierro</a></b> <i>(pictured)</i> in Mexico was designed by <a href=\"/wiki/Gustave_Eiffel\" title=\"Gustave Eiffel\">Gustave Eiffel</a>?</li>", "<li>... that <b><a href=\"/wiki/Thomas_Seavey_Hall\" title=\"Thomas Seavey Hall\">Thomas Seavey Hall</a></b><span class=\"nowrap\">'s</span> <a href=\"/wiki/Banjo\" title=\"Banjo\">banjo</a> signals caused a judge to declare him the father of American automatic electric railroad signaling?</li>", "<li>... that <b><a href=\"/wiki/Brassey%27s\" title=\"Brassey's\">Brassey's</a></b>, \"said to be the oldest established name in defence publishing\", traces its history back to <i><a href=\"/wiki/The_Naval_Annual\" title=\"The Naval Annual\">The Naval Annual</a></i> in 1886?</li>", "<li>... that <a href=\"/wiki/Bea_Alonzo\" title=\"Bea Alonzo\">Bea Alonzo</a> <b><a href=\"/wiki/Bea_Alonzo_filmography\" title=\"Bea Alonzo filmography\">had her breakout role</a></b> at the age of 15 in the 2002 drama series <i><a href=\"/wiki/Kay_Tagal_Kang_Hinintay\" title=\"Kay Tagal Kang Hinintay\">Kay Tagal Kang Hinintay</a></i>, in which she played a lawyer?</li>", "<li>... that after his <a href=\"/wiki/Association_football\" title=\"Association football\">soccer</a> career, <b><a href=\"/wiki/Steve_Palacios\" title=\"Steve Palacios\">Steve Palacios</a></b> enlisted in the <a href=\"/wiki/United_States_Army\" title=\"United States Army\">United States Army</a> and played for the <a href=\"/wiki/United_States_Armed_Forces\" title=\"United States Armed Forces\">United States Armed Forces</a> soccer team?</li>", "<li>... that <a href=\"/wiki/Nutan\" title=\"Nutan\">Nutan</a>, the lead actress of the 1951 <a href=\"/wiki/Motion_picture_content_rating_system#India\" title=\"Motion picture content rating system\">A-rated</a> suspense thriller <i><b><a href=\"/wiki/Nagina_(1951_film)\" title=\"Nagina (1951 film)\">Nagina</a></b></i>, was not allowed to enter the film's premiere because she was underage?</li>", "<li>... that Tennessee lawyer <b><a href=\"/wiki/Bolton_Smith\" title=\"Bolton Smith\">Bolton Smith</a></b> was known for his work integrating African Americans into the Boy Scouts?</li>", "<li>... that a giant breast destroying a spaceship <a href=\"/wiki/Mark_Zuckerberg\" title=\"Mark Zuckerberg\">Mark Zuckerberg</a> in the music video for \"<b><a href=\"/wiki/Ay_mam%C3%A1\" title=\"Ay mam\u00e1\">Ay mam\u00e1</a></b>\" is a criticism of <a href=\"/wiki/Meta_Platforms\" title=\"Meta Platforms\">Meta</a>'s censorship of female nipples?</li>"]}
