{"text": ["<li><a href=\"/wiki/580s_BC\" title=\"580s BC\">585\u00a0BC</a> \u2013 According to the Greek historian <a href=\"/wiki/Herodotus\" title=\"Herodotus\">Herodotus</a>, <b><a href=\"/wiki/Eclipse_of_Thales\" title=\"Eclipse of Thales\">a solar eclipse</a></b>, accurately predicted by <a href=\"/wiki/Thales_of_Miletus\" title=\"Thales of Miletus\">Thales of Miletus</a>, abruptly ended the <a href=\"/wiki/Battle_of_the_Eclipse\" title=\"Battle of the Eclipse\">Battle of Halys</a> between the <a href=\"/wiki/Lydia\" title=\"Lydia\">Lydians</a> and the <a href=\"/wiki/Medes\" title=\"Medes\">Medes</a>.</li>", "<li><a href=\"/wiki/1754\" title=\"1754\">1754</a> \u2013 <a href=\"/wiki/French_and_Indian_War\" title=\"French and Indian War\">French and Indian War</a>: Led by 22-year-old <a href=\"/wiki/George_Washington\" title=\"George Washington\">George Washington</a>, a company of <a href=\"/wiki/Colony_of_Virginia\" title=\"Colony of Virginia\">Virginia</a> colonial <a href=\"/wiki/Militia_(United_States)\" title=\"Militia (United States)\">militiamen</a> ambushed a force of 35 <a href=\"/wiki/French_Canadians\" title=\"French Canadians\">Canadiens</a> at the <b><a href=\"/wiki/Battle_of_Jumonville_Glen\" title=\"Battle of Jumonville Glen\">Battle of Jumonville Glen</a></b> <i>(depicted)</i>.</li>", "<li><a href=\"/wiki/1937\" title=\"1937\">1937</a> \u2013 The <b><a href=\"/wiki/Rise_of_Neville_Chamberlain\" title=\"Rise of Neville Chamberlain\">rise of Neville Chamberlain</a></b> culminated with his accession as <a href=\"/wiki/Prime_Minister_of_the_United_Kingdom\" title=\"Prime Minister of the United Kingdom\">Prime Minister of the United Kingdom</a>.</li>", "<li><a href=\"/wiki/1998\" title=\"1998\">1998</a> \u2013 The <a href=\"/wiki/Pakistan_Atomic_Energy_Commission\" title=\"Pakistan Atomic Energy Commission\">Pakistan Atomic Energy Commission</a> carried out <b><a href=\"/wiki/Chagai-I\" title=\"Chagai-I\">five underground nuclear tests</a></b>, becoming the <a href=\"/wiki/List_of_states_with_nuclear_weapons\" title=\"List of states with nuclear weapons\">seventh country in the world to successfully develop</a> and publicly test <a href=\"/wiki/Nuclear_weapon\" title=\"Nuclear weapon\">nuclear weapons</a>.</li>", "<li><a href=\"/wiki/2002\" title=\"2002\">2002</a> \u2013 An independent commission appointed by <a href=\"/wiki/The_Football_Association\" title=\"The Football Association\">the Football Association</a> voted two-to-one to allow <a href=\"/wiki/Wimbledon_F.C.\" title=\"Wimbledon F.C.\">Wimbledon F.C.</a> <b><a href=\"/wiki/Relocation_of_Wimbledon_F.C._to_Milton_Keynes\" title=\"Relocation of Wimbledon F.C. to Milton Keynes\">to relocate from London</a></b> to <a href=\"/wiki/Milton_Keynes\" title=\"Milton Keynes\">Milton Keynes</a>.</li>"]}
