{"text": ["<li>... that <b><a href=\"/wiki/The_Most_Dangerous_Animal_in_the_World\" title=\"The Most Dangerous Animal in the World\">The Most Dangerous Animal in the World</a></b> <i>(pictured)</i> was an exhibit at the <a href=\"/wiki/Bronx_Zoo\" title=\"Bronx Zoo\">Bronx Zoo</a> in 1963?</li>", "<li>... that the judging committee of the <b><a href=\"/wiki/Manga_Taish%C5%8D\" title=\"Manga Taish\u014d\">Manga Taish\u014d</a></b>, an annual <a href=\"/wiki/Manga\" title=\"Manga\">manga</a> prize, is composed primarily of bookstore workers?</li>", "<li>... that Indian women's hockey player <b><a href=\"/wiki/Elvera_Britto\" title=\"Elvera Britto\">Elvera Britto</a></b> and her sisters would stitch their own team uniforms while playing in the 1960s?</li>", "<li>... that <i><b><a href=\"/wiki/XO,_Kitty\" title=\"XO, Kitty\">XO, Kitty</a></b></i>, based on the film series <i>To All the Boys I've Loved Before</i>, is planned to be the first Netflix series to be spun off from a Netflix original film?</li>", "<li>... that Austrian doctor <b><a href=\"/wiki/Paul_Bargehr\" title=\"Paul Bargehr\">Paul Bargehr</a></b> was decried for exposing healthy Indonesians to the leprosy bacillus in his experiments?</li>", "<li>... that \"<b><a href=\"/wiki/Segne,_Vater,_diese_Gaben\" title=\"Segne, Vater, diese Gaben\">Segne, Vater, diese Gaben</a></b>\", a <a href=\"/wiki/Round_(music)\" title=\"Round (music)\">round</a> for <a href=\"/wiki/Grace_(prayer)\" title=\"Grace (prayer)\">saying grace</a> of unknown authorship, has appeared in German collections for kindergarten, schools and events for young people?</li>", "<li>... that during the <b><a href=\"/wiki/Qarmatian_invasion_of_Iraq\" title=\"Qarmatian invasion of Iraq\">Qarmatian invasion of Iraq</a></b>, the <a href=\"/wiki/Abbasid_Caliphate\" title=\"Abbasid Caliphate\">Abbasid Caliphate</a> raised an army of more than 40,000 men to protect <a href=\"/wiki/Baghdad\" title=\"Baghdad\">Baghdad</a>, but did not engage the few thousand <a href=\"/wiki/Qarmatians\" title=\"Qarmatians\">Qarmatians</a> in battle?</li>", "<li>... that shortly before <a href=\"/wiki/Shooting_sports\" title=\"Shooting sports\">sports shooter</a> <b><a href=\"/wiki/William_Riedell\" title=\"William Riedell\">William Riedell</a></b> was to compete in the <a href=\"/wiki/1936_Summer_Olympics\" title=\"1936 Summer Olympics\">1936 Olympics</a>, he had his pistols confiscated by the New York police because the precinct chief had decided there were \"too many guns\"?</li>"]}
