{"text": ["<li><a href=\"/wiki/1854\" title=\"1854\">1854</a> \u2013  The <b><a href=\"/wiki/Kansas%E2%80%93Nebraska_Act\" title=\"Kansas\u2013Nebraska Act\">Kansas\u2013Nebraska Act</a></b> became law, establishing the <a href=\"/wiki/List_of_states_and_territories_of_the_United_States\" title=\"List of states and territories of the United States\">U.S. territories</a> of <a href=\"/wiki/Nebraska_Territory\" title=\"Nebraska Territory\">Nebraska</a> and <a href=\"/wiki/Kansas_Territory\" title=\"Kansas Territory\">Kansas</a>, and allowing their settlers to determine if <a href=\"/wiki/Slavery_in_the_United_States\" title=\"Slavery in the United States\">slavery</a> would be permitted.</li>", "<li><a href=\"/wiki/1866\" title=\"1866\">1866</a> \u2013 <a href=\"/wiki/Bed%C5%99ich_Smetana\" title=\"Bed\u0159ich Smetana\">Bed\u0159ich Smetana</a>'s comic opera <i><b><a href=\"/wiki/The_Bartered_Bride\" title=\"The Bartered Bride\">The Bartered Bride</a></b></i> premiered in <a href=\"/wiki/Prague\" title=\"Prague\">Prague</a>.</li>", "<li><a href=\"/wiki/1922\" title=\"1922\">1922</a> \u2013 The <b><a href=\"/wiki/Lincoln_Memorial\" title=\"Lincoln Memorial\">Lincoln Memorial</a></b> in <a href=\"/wiki/Washington,_D.C.\" title=\"Washington, D.C.\">Washington, D.C.</a>, featuring <a href=\"/wiki/Statue_of_Abraham_Lincoln_(Lincoln_Memorial)\" title=\"Statue of Abraham Lincoln (Lincoln Memorial)\">a sculpture</a> of the sixteenth U.S. president <a href=\"/wiki/Abraham_Lincoln\" title=\"Abraham Lincoln\">Abraham Lincoln</a> <i>(pictured)</i> by <a href=\"/wiki/Daniel_Chester_French\" title=\"Daniel Chester French\">Daniel Chester French</a>, opened.</li>", "<li><a href=\"/wiki/1972\" title=\"1972\">1972</a> \u2013 Members of the <a href=\"/wiki/Japanese_Red_Army\" title=\"Japanese Red Army\">Japanese Red Army</a> carried out the <b><a href=\"/wiki/Lod_Airport_massacre\" title=\"Lod Airport massacre\">Lod Airport massacre</a></b> in <a href=\"/wiki/Tel_Aviv\" title=\"Tel Aviv\">Tel Aviv</a>, Israel, on behalf of <a href=\"/wiki/Popular_Front_for_the_Liberation_of_Palestine_%E2%80%93_External_Operations\" title=\"Popular Front for the Liberation of Palestine \u2013 External Operations\">PFLP External Operations</a>, killing over 20 people and injuring almost 80 others.</li>", "<li><a href=\"/wiki/2008\" title=\"2008\">2008</a> \u2013 The <b><a href=\"/wiki/Convention_on_Cluster_Munitions\" title=\"Convention on Cluster Munitions\">Convention on Cluster Munitions</a></b>, prohibiting the use, transfer, and stockpiling of <a href=\"/wiki/Cluster_munition\" title=\"Cluster munition\">cluster bombs</a>, was adopted.</li>"]}
